import React, { useEffect, useState } from 'react';
import '../styles/Bookings.css';
import axios from 'axios';
import { useNavigate, useLocation } from 'react-router-dom';

const Bookings = () => {
  const navigate = useNavigate();
  const location = useLocation();
  console.log('Location State:', location.state);
  const { selectedSeats } = location.state || {}; // Destructure selectedSeats from the location state

  const [bookings, setBookings] = useState([]);
  const userId = localStorage.getItem('userId');

  

  const fetchBookings = async () => {
    try {
      const response = await axios.get('http://localhost:6001/fetch-bookings');
      setBookings(response.data.reverse());
    } 
    catch (error) {
      console.error('Error fetching bookings:', error);
    }
  };

  useEffect(() => {
    fetchBookings();
  }, []);

  const cancelTicket = async (id) => {
    try {
      await axios.put(`http://localhost:6001/cancel-ticket/${id}`);
      alert('Ticket cancelled!');
      fetchBookings(); // Refresh bookings after cancellation
    } 
    catch (error) {
      console.error('Error cancelling ticket:', error);
    }
  };

  const userBookings = bookings.filter((booking) => booking.user === userId);

  return (
    <div className="flight-ticket">
      <h1>My Bookings</h1>
      <div className="bookings-container">
        {userBookings.map((booking) => (
          <div >
          <div className="ticket-header">
            <div className="route-info">
              <div className="departure">
                <h2>{booking.departure?.slice(0, 3).toUpperCase() || 'DEP'}</h2>
                <p>{booking.departure}</p>
              </div>
              <div className="flight-path">
                <div className="flight-line"></div>
                <div className="flight-icon">
                  <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="#3b82f6">
                    <path d="M21 16v-2l-8-5V3.5c0-.83-.67-1.5-1.5-1.5S10 2.67 10 3.5V9l-8 5v2l8-2.5V19l-2 1.5V22l3.5-1 3.5 1v-1.5L13 19v-5.5l8 2.5z"/>
                  </svg>
                </div>
              </div>
              <div className="arrival">
                <h2>{booking.destination?.slice(0, 3).toUpperCase() || 'ARR'}</h2>
                <p>{booking.destination}</p>
              </div>
            </div>
          </div>
          <div className="ticket-details">
            <div className="detail-grid">
              <div className="detail-item">
                <label>Date</label>
                <p>{booking.journeyDate?.slice(0, 10) || 'N/A'}</p>
              </div>
              <div className="detail-item">
                <label>Time</label>
                <p>{booking.journeyTime}</p>
              </div>
              <div className="detail-item">
                <label>Flight</label>
                <p>RS {booking.flightId}</p>
              </div>
            </div>
            <div className="passenger-info">
              <label>Passenger</label>
              <p>{booking.passengers?.[0]?.name || 'N/A'}</p>
            </div>
            <div className="ticket-actions">
              {booking.bookingStatus === 'confirmed' && (
                <button className="cancel-btn">Cancel Ticket</button>
              )}
              <div className={`ticket-status ${booking.bookingStatus}`}>
                {booking.bookingStatus}
              </div>
            </div>
          </div>
        </div>
        ))}
      </div>
    </div>    
  );
};

export default Bookings;
